CREATE TABLE `TEMPLATE_TABLE` (
  `id` varchar(50) NOT NULL DEFAULT '' COMMENT '主键',
  `code` varchar(100) DEFAULT NULL COMMENT '编码',
  `department_name` varchar(128) DEFAULT NULL COMMENT '部门名称',
  `department_code` varchar(128) DEFAULT NULL COMMENT '部门编码',
  `parent_department_name` varchar(128) DEFAULT NULL COMMENT '父级部门名称',
  `parent_department_code` varchar(128) DEFAULT NULL COMMENT '父级部门编码',
  `company_name` varchar(0) DEFAULT NULL COMMENT '公司名称',
  `department_account` varchar(50) DEFAULT NULL COMMENT '部门交互账号',
  `balance` decimal(65,30) DEFAULT NULL COMMENT '收款金额',
  `unuse_amount` decimal(65,30) DEFAULT NULL COMMENT '未使用金额',
  `already_amount` decimal(65,30) DEFAULT NULL COMMENT '已使用金额',
  `account_type` varchar(100) DEFAULT NULL COMMENT '账号类型',
  `datasource` char(1) DEFAULT NULL COMMENT '数据来源：0：手动导入 1：自动导入',
  `status` char(1) DEFAULT NULL COMMENT '状态，1 成功；2失败',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_user` varchar(44) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(44) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `test_code` varchar(200) DEFAULT NULL COMMENT '测试编码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='交互记录';


